import CardPlayer from '../CardPlayer'
import './Club.css'

const Club = (props) => {
    return(
        <section className='club' style={{ backgroundColor: props.secondColor }}>
            <h3 style={{ borderColor: props.primaryColor }}>{props.name}</h3>
            {props.players.map(player => <CardPlayer />)}
        </section>
    )
}

export default Club
